webpackJsonp([0xe0a6e116e138],{"./node_modules/json-loader/index.js!./.cache/json/shape-anew.json":function(n,a){n.exports={data:{site:{siteMetadata:{title:"Mal Types!",author:"Mallory Allen"}},markdownRemark:{id:"/Users/mallen/src/github.com/themallen/gatsby-blog/src/pages/2017-10-01-Shape-Anew/index.md absPath of file >>> MarkdownRemark",html:'<p><img src="http://gatherer.wizards.com/Handlers/Image.ashx?multiverseid=194201&#x26;type=card" alt="Shape Anew"></p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>  <span class="token operator">></span> ~/src gatsby new mal-blog\n</code></pre>\n      </div>\n<br>\n<h2>Blog, get!</h2>\n<p>This years October Resolution (A <em>hallowed</em> tradition), was to actually get on top\nof this whole having a blog thing. As you can see, I don’t waste any ⏲️\nwhen it comes to those.</p>\n<p>I’m super hyped to get started writing some real entries.\nI’ve got all kinds of ideas bouncing around in my brain-meats,\nand you can expect to hear my takes on:</p>\n<ul>\n<li>conferences I attend</li>\n<li>problems I solve at work</li>\n<li>the challenges of mentorship</li>\n<li>random nerd stuff (magic cards)</li>\n<li>music</li>\n<li>cat ownership</li>\n</ul>\n<h2>How did u make this tho?</h2>\n<p>This blog was built using <a href="https://www.gatsbyjs.org/">Gatsby</a>, and you should\ndefinitely check it out if you’re into all that javascript hullabaloo that the kids\nare always talking about.</p>\n<p>Speaking of which, I should probably warn you.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>  <span class="token keyword">export</span> <span class="token keyword">default</span> <span class="token keyword">async</span> <span class="token keyword">function</span> <span class="token function">blog</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">await</span> <span class="token function">peopleWhoDontWantToReadAboutJavascriptGoingHome</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n    <span class="token function">writeCoolContent</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>There’s gonna be, like, a <em>lot</em> of JS on this blog. Just sayin’.</p>',frontmatter:{title:"Shape Anew",date:"October 01, 2017"}}},pathContext:{path:"/shape-anew/"}}}});
